//auf testsuite eben


//variablen setzen

import com.eviware.soapui.support.types.StringToStringMap 

for (a = 0; a <runner.testSuite.testCaseCount; a++) {

 runner.getTestSuite().getTestCaseAt(a).setPropertyValue( "customerNumber", "EnterCustomerNumber" )
 runner.getTestSuite().getTestCaseAt(a).setPropertyValue( "customerSignature", "EntercustomerSignature" )
 runner.getTestSuite().getTestCaseAt(a).setPropertyValue( "interfacePartnerNumber", "EnterinterfacePartnerNumber" )
 runner.getTestSuite().getTestCaseAt(a).setPropertyValue( "interfacePartnerSignature", "EnterinterfacePartnerSignature" )
 runner.getTestSuite().getTestCaseAt(a).setPropertyValue( "customerLogin", "EntercustomerLogin" )
 runner.getTestSuite().getTestCaseAt(a).setPropertyValue( "productVariant", "EnterProductVariant" )


def headers = new StringToStringMap()

//werte übergeben
headers.put("customerNumber", '${#Project#customerNumber}')
headers.put("customerSignature", '${#Project#customerSignature}')
headers.put("interfacePartnerNumber", '${#Project#interfacePartnerNumber}')
headers.put("interfacePartnerSignature", '${#Project#interfacePartnerSignature}')
headers.put("customerLogin", '${#Project#customerLogin}')
headers.put("productVariant", '${#Project#productVariant}')


 runner.getTestSuite().getTestCaseAt(a).getTestSteps().each
 {
  q->
  if(q.getValue().config.type.equals("restrequest") || q.getValue().config.type.equals("request"))
  {
   q.getValue().getHttpRequest().setRequestHeaders(headers)
  }
 }

}


