//TestCase Options
//set Options for timeout

//timeout of testcase 40s for every TestStep
def timeoutNew= 0
for (a = 0; a <runner.testSuite.testCaseCount; a++) {
def timeoutWithCalculation =runner.getTestSuite().getTestCaseAt(a).getTestStepCount()*60000000

//get
timeoutNew = runner.getTestSuite().getTestCaseAt(a).config.timeout

 runner.getTestSuite().getTestCaseAt(a).config.timeout = timeoutWithCalculation
 runner.getTestSuite().getTestCaseAt(a).config.failOnError = false
 runner.getTestSuite().getTestCaseAt(a).config.failTestCaseOnErrors = true
 runner.getTestSuite().getTestCaseAt(a).config.keepSession = true
 runner.getTestSuite().getTestCaseAt(a).config.searchProperties = true
 runner.getTestSuite().getTestCaseAt(a).config.wsrmEnabled = false
 runner.getTestSuite().getTestCaseAt(a).config.amfAuthorisation = false
}


TimeZone.setDefault(TimeZone.getTimeZone('EST'))
def now = new Date();
def begin = new Date().minus(3);
def future = new Date().plus(12461);
def future50daybegin = new Date().plus(17820);
def future50dayend = new Date().plus(17823);
def past = new Date().minus(1780);
def duration = now.minus(begin-1).toString();
def future31day = new Date().minus(31);
log.info(duration)

def future31dayformat= future31day.format("yyyy-MM-dd")
def ExecutionStartDate = now.format("yyyy-MM-dd")
def futureDate = future.format("yyyy-MM-dd")
def future50yBegin = future50daybegin.format("yyyy-MM-dd")
def future50yEnd = future50dayend.format("yyyy-MM-dd")
def pastDate = past.format("yyyy-MM-dd")
def beginDate = begin.format("yyyy-MM-dd")

runner.testSuite.project.setPropertyValue("future31day",future31dayformat)
runner.testSuite.project.setPropertyValue("beginDate",beginDate)
runner.testSuite.project.setPropertyValue("currentDate",ExecutionStartDate)
runner.testSuite.project.setPropertyValue("futureDate",futureDate)
runner.testSuite.project.project.setPropertyValue("future50yBegin",future50yBegin)
runner.testSuite.project.project.setPropertyValue("future50yEnd",future50yEnd)
runner.testSuite.project.project.setPropertyValue("pastDate",pastDate)
runner.testSuite.project.project.setPropertyValue("duration",duration)
